const Menu = () => {
  const menuItems = [
    {
      id: 1,
      name: "Truffle Pasta",
      description: "Creamy pasta with black truffle and parmesan",
      price: "$18.99",
      category: "main"
    },
    {
      id: 2,
      name: "Margherita Pizza",
      description: "Classic pizza with tomato sauce and mozzarella",
      price: "$14.99",
      category: "main"
    },
    {
      id: 3,
      name: "Caesar Salad",
      description: "Romaine lettuce, croutons, parmesan with Caesar dressing",
      price: "$10.99",
      category: "starter"
    },
    {
      id: 4,
      name: "Chocolate Lava Cake",
      description: "Warm chocolate cake with a molten center",
      price: "$8.99",
      category: "dessert"
    }
  ];

  return (
    <section className="menu" id="menu">
      <div className="container">
        <h2 className="section-title">Our Menu</h2>
        <div className="menu-categories">
          <button className="active">All</button>
          <button>Starters</button>
          <button>Main Course</button>
          <button>Desserts</button>
          <button>Drinks</button>
        </div>
        <div className="menu-items">
          {menuItems.map(item => (
            <div className="menu-item" key={item.id}>
              <div className="item-info">
                <h3>{item.name}</h3>
                <p>{item.description}</p>
              </div>
              <span className="item-price">{item.price}</span>
            </div>
          ))}
        </div>
        <button className="btn-primary view-all">View Full Menu</button>
      </div>
    </section>
  );
};

export default Menu;
